I chose .DMG because it is a very practical file type for mac users; just double-click it and it opens on your desktop, no difficulties. BTW, fairly most of the file is empty, so the download is pretty fast. I am monitoring some of the downloads I am currently seeding, and these are really fast, downloading it all in less than 10 minutes at a speed of, sometimes, less than 1KB/s.

